    "2016-07-27T22:58:03.921207",nt"name": "wind-tunnel-experiments-to-assess-the-effect-of-back-mounted-radio-transmitters-on-bird-bo",nt"isopen":
    false,nt"url": null,nt"notes": "The aerodynamic drag of bird bodies was
    measured in a wind tunnel, with and without back-mounted dummy radio transmitters.
    Flight performance estimates indicate that the drag of a large transmitter can cause
    a substantial reduction of a migrant's range, that is, the distance it can cover
    in non-stop flight. The drag of the transmitter can be reduced by arranging the
    components in an elongated shape, so minimizing the frontal area. The addition of
    a rounded fairing to the front end, and a pointed fairing behind, was found to reduce
    the drag of the transmitter by about one-third, as compared with an unfaired rectangular
    box.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
